import React, { useState } from "react";
import { Link, NavLink } from "react-router-dom";
import styles from "./NavBar.module.css";

const NavBar = () => {
  //     let dataAos = data-aos
  //   const [linkStyle, setLinkStyle] = useState( {data-aos: "fade-right"} );

  return (
    <header className={styles.navbar}>
      <nav>
        <ul>
          <li>
            <Link activeClassName={styles.active} to="/planets" data-aos="">
              Planets
            </Link>
          </li>
          <li>
            <Link activeClassName={styles.active} to="/characters" data-aos="">
              Characters
            </Link>
          </li>
          <li>
            <Link
              activeClassName={styles.active}
              to="/starships"
              data-aos="fade-right"
            >
              Starships
            </Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default NavBar;
